import React, { Component } from 'react';

export class Home extends Component{
    render(){
        return(
            <div>
      Hello my name is Jiachen Zhang, the following picture is my favorite
      carton character, Ice Bear.
    <img src="ice_bear.jpg" alt="IceBear" />
            </div>
        );
    }
}
export default Home;
